from dpymenus import PaginatedMenu, Template template = Template(...)
menu = PaginatedMenu(ctx)
menu.add_pages([...], template=template) We want to import the Template class, which is exposed in the base dpymenus namespace. We can then create a new Template instance. The template takes a variety of keyword arguments: title: string description: string color: string footer: dictionary -> { text: string , icon_url: string } image: string url: string thumbnail: string author: dictionary -> { name: string, url: string, icon_url: string } fields: list -> dictionary -> { name: string , value: string , inline: boolean } field_style * field_sort * * see the next page for details Most of these are self-explanatory, as they mirror the same attributes on an Embed or Page. An important distinction is what values they take -- typically favoring a single string representing the data.
